import React, {useEffect} from 'react';


const FetchSchedules = () => {
	useEffect(() => {
		// fetch
		fetch('https://api.rasp.yandex.net/v3.0/search/?apikey=b4bb1709-f368-422c-9466-87821be7f87c&format=json&from=s9600871&to=s9602460&lang=ru_RU&page=1&date=2022-09-04')
			.then(response => response.json())
			.then(json => console.log(json))
		//
	}, []);

	return (
		<div>
			hello fetch
		</div>
	);
};

export default FetchSchedules;
